import LoginLink from "../Loginthingys/LoginLink";
import classes from "./Headerthingys.module.css";
import { Link } from "react-router-dom";
import logo from "../../assests/Logo.png";
import { useState } from "react";


const Headerbar = (props) => {

	const [isLoggedin, setisLoggedin] = useState(false);

	function makeLogin(){
		setisLoggedin(true);
	}

	function removeLogin(){
		setisLoggedin(false);
	}

	return (
		<div className={classes.header}>
			<div className={classes.flexcontainer}>
				<div className={`${classes.item} ${classes.item1}`}>
					<Link to="/">
						<img src={logo} height={40} width={60} />
					</Link>
				</div>
				<div className={`${classes.item} ${classes.item2}`}>
					<div>
						<form>
							<input
								list="locations"
								id="hostel-locations"
								placeholder="Search for hostels within IITG"
							/>
							<datalist id="locations">
								<option value="Siang Hostel">Siang Hostel</option>
								<option value="Lohit Hostel">Lohit Hostel</option>
								<option value="Disang Hostel">Disang Hostel</option>
								<option value="Brahmaputra Hostel">Brahmaputra Hostel</option>
							</datalist>
						</form>
					</div>
				</div>
				<div className={`${classes.item} ${classes.item3}`}>
					<form>
						<input
							list="items"
							id="item-names"
							placeholder="Find Mobile Phones, Books and more..."
						/>
						<datalist id="items">
							<option value="mobiles">Mobiles</option>
							<option value="Laptops">Laptops</option>
							<option value="Cycles">Cycles</option>
							<option value="Mattresses">Mattresses</option>
						</datalist>
						<button>
							<img
								src="https://thumbs.dreamstime.com/b/search-icon-vector-found-find-concept-magnifying-glass-sign-isolated-black-background-search-icon-vector-found-find-concept-132462908.jpg"
								width={30}
								height={30}
							/>
						</button>
					</form>
				</div>
				
				<div className={`${classes.item} ${classes.item4}`}>
					{isLoggedin ? <LoginLink /> : <ProfileLink />}
				</div>
				<div className={`${classes.item} ${classes.item4}`}>
					<Link to="/post-ad">
						<strong>SELL</strong>
					</Link>
				</div>
			</div>
		</div>
	);
};

export default Headerbar;
